import os

def get_image_filenames(directory):
    image_filenames = []
    for root, dirs, files in os.walk(directory):
        for f in files:
            if '.' in f and 'jpg' in f.rsplit('.', 1)[1].lower():
                image_filenames.append(os.path.join(root, f))
    return image_filenames

def create_image_directory(name):
    os.mkdir(name)
    return name

def copy_images(image_filenames, destination_dir):
    for filename in image_filenames:
        shutil.copyfile(filename, os.path.join(destination_dir, os.path.basename(filename)))

