import os

def get_file_metadata(filepath):
    stat = os.stat(filepath)
    metadata = {
        "size": stat.st_size,
        "permissions": stat.st_mode,
        "last_modified": stat.st_mtime
    }
    return metadata

def write_to_log(message):
    with open("/var/log/metadata.log", "a") as f:
        f.write(message + '\n')

def log_metadata(filepath):
    metadata = get_file_metadata(filepath)
    write_to_log(str(metadata))

log_metadata("report.pdf")

