import pickle

class Survey:
    def __init__(self, prompt, answer):
        self.prompt = prompt
        self.answer = answer

def get_user_input():
    prompt = input("Enter survey prompt: ")
    answer = input("Enter survey answer: ")
    return Survey(prompt, answer)

def save_survey(survey):
    data = pickle.dumps(survey)
    with open('survey.pickle', 'wb') as f:
        f.write(data)

def load_survey():
    with open('survey.pickle', 'rb') as f:
        data = f.read()
    survey = pickle.loads(data)
    return survey

if __name__ == '__main__':
    survey = load_survey()
    print(f"Prompt: {survey.prompt}")
    print(f"Answer: {survey.answer}")

