import os

def remove_empty_files(root):
    for dir, dirs, files in os.walk(root):
        for f in files:
            fp = os.path.join(dir, f)
            if os.stat(fp).st_size == 0:
                os.remove(fp)
                print(f'Removed empty file: {fp} ')
